  `provider` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `provider_account_id` varchar(200) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `unlinked` tinyint(1) NOT NULL DEFAULT '0',
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `ui_email_uidx` (`email`),
  UNIQUE KEY `ui_provider_and_id_uidx` (`provider`,`provider_account_id`)
